import React from 'react';
import s from './users.module.css';

let Users = (props) => {
    if (props.users.length === 0) {
        props.setUsers([
            {
                id: 1,
                photoUrl: 'data:image/jpeg;base64,',
                followed: true,
                fullName: 'Alex Smith',
                status: 'My project',
                location: {city: 'Sumy', country: 'Ukraine'}
            },
            {
                id: 2,
                photoUrl: 'data:image/jpeg;base64,',
                followed: true,
                fullName: 'Dmitry Zhdanov',
                status: 'First partner',
                location: {city: 'Kiev', country: 'Ukraine'}
            },
            {
                id: 3,
                photoUrl: 'data:image/jpeg;base64,',
                followed: true,
                fullName: 'Alexander Prokopenko',
                status: 'First assistant',
                location: {city: 'Sumy', country: 'Ukraine'}
            },
            {
                id: 4,
                photoUrl: 'data:image/jpeg;base64,',
                followed: false,
                fullName: 'Vladimir Suslov',
                status: 'Second assistant',
                location: {city: 'Sumy', country: 'Ukraine'}
            },
        ])
    }

    return <div>
        {
            props.users.map(u => <div key={u.id} className={s.userWrapper}>
                <div className={s.PhotoAndButton}>
                    <div>
                        <img src={u.photoUrl} alt="=(" className={s.userPhoto}/>
                    </div>
                    { u.followed
                        ? <button onClick={() => {props.unfollow(u.id)}}>Unfollow</button>
                        : <button onClick={() => {props.follow(u.id)}}>Follow</button>
                    }
                </div>
                <div className={s.UserInfo}>
                        <div className={s.UserName}>{u.fullName}</div>
                        <div className={s.UserStatus}>{u.status}</div>
                        <div className={s.UserCity}>
                            {u.location.city},
                        </div>
                        <div className={s.UserCountry}>
                            {u.location.country}
                        </div>
                </div>
            </div>)
        }
    </div>
}

export default Users;